import React, {Component} from 'react';

function FetchOpenWeather(props) {
    fetch('http://openweathermap.org/data/2.5/weather?q=%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0&appid=b6907d289e10d714a6e88b30761fae22', {
        method: "GET",
        headers: new Headers({'Accept': 'application/json',
            'Content-Type': 'application/json'
        })})
            .then((response) => response.json())
            .then(result => {
                console.log(result)
                    })
}

export default FetchOpenWeather;
